// 실제 CSV 파일에서 데이터 로드
export const loadRestaurantData = async () => {
  try {
    // 하드코딩된 데이터를 앱 형식으로 변환
    const restaurants = restaurantData.map((restaurant, index) => ({
      id: `restaurant_${index}`,
      name: restaurant.name,
      address: restaurant.address,
      latitude: restaurant.latitude,
      longitude: restaurant.longitude,
      distance: restaurant.distance,
      // 기본값 설정
      rating: 0,
      reviewCount: 0,
      category: '한식', // 기본 카테고리
      phone: '',
      website: '',
      openingHours: '',
      priceRange: '',
      photos: [],
      reviews: []
    }));
    
    console.log(`식당 데이터 로드 완료: ${restaurants.length}개`);
    return restaurants;
    
  } catch (error) {
    console.error('데이터 로드 오류:', error);
    return [];
  }
};

// CSV 파일 경로
export const CSV_FILE_PATH = './data/restaurants.csv';

// 파일 존재 여부 확인 (개발 환경에서만 사용)
export const checkCSVFile = () => {
  try {
    // Node.js 환경에서 파일 존재 확인
    const fs = require('fs');
    return fs.existsSync(CSV_FILE_PATH);
  } catch (error) {
    console.log('파일 확인 불가 (React Native 환경)');
    return false;
  }
}; 